import React from 'react';
import CHoose from './choose';

function ChooseDoc()
{
    const [doctors, setDoctors] = useState([]);

  useEffect(() => {
    fetch('/appointmentsDo.json') 
      .then((res) => res.json())
      .then((result) => {
        console.log('Fetched Data:', result);
        setDoctors(result);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);
    return(
    <div className='assign'>
        <u><p className='home-logout'><a href='/SignInPage'>logout</a></p></u>
        <u><p className='home-logout'><a href='/'>Home</a></p></u>
        <h1 className='header2'>Doctors list</h1>
        <table >
          <thead>
           <tr >
            <th>Name</th>
            <th>speciality</th>
           </tr>
          </thead>
          <tbody>
           <tr>
            <td>{Docs.Doc1}</td>
            <td>{Docs.speciality1}</td>
            <button onClick={CHoose(Docs.Doc1)}><a href='/ShowAppointment'>Choose</a></button>
           </tr>
           <tr>
            <td>{Docs.Doc2}</td>
            <td>{Docs.speciality2}</td>
            <button onClick={CHoose(Docs.Doc2)}><a href='/ShowAppointment'>Choose</a></button>
           </tr>
           <tr>
            <td>{Docs.Doc3}</td>
            <td>{Docs.speciality3}</td>
            <button onClick={CHoose(Docs.Doc1)}><a href='/ShowAppointment'>Choose</a></button>
           </tr>
         </tbody>
        </table>
        <button ><a href='/'>Back</a></button>
    </div>
    )
    
}
export default ChooseDoc;
